<html>
    <head>
        <title>Python button script</title>

        <link rel="preconnect" href="https://fonts.googleapis.com">
        <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>

    </head>
    <body>

      

        <div id="map-box">hello</div>
        <div id="input-box">"hello"</div> <!-- creates a section that will contain details for hover stuff from the style.css -->
        <div id="display-box">hello</div>
        <script> // tags a javascript!

            // document.addEventListener('click',function (e){
            //     if (e.target.tagName == 'circle'){
            //       // var url = "{%url 'hover' %}";
            //       // var url_mask = "document.location.href = '{% url 'hover' %}'";
            //       // document.location.href = "{%url 'hover' %}"
            //       // var url_mask = "{{data}}"
            //       document.getElementById("details-box").innerHTML = url_mask; 
            //       document.getElementById("details-box").style.opacity = "50%";
            //   }

              document.addEventListener('click',function (e){
                if (e.target.tagName == 'circle'){
                    const xhttp = new XMLHttpRequest(); // created XMLHttpRequest Object
                    xhttp.open("POST", "{%url 'hover' %}",true); // creates a new url request from the server
                    
                    xhttp.onload = function() {
                      document.getElementById("details-box").innerHTML = document.location.href = '{% url 'hover' %}'; 
                    }
                    xhttp.send();
                  // var url = "{%url 'hover' %}";
                  // var url_mask = "document.location.href = '{% url 'hover' %}'";
                  // document.location.href = "{%url 'hover' %}"
                  // var url_mask = "{{data}}"
                  
                  document.getElementById("details-box").style.opacity = "50%";
              }
            });

            var tooltipSpan = document.getElementById('details-box'); // defines variable, referencing the document
            //, which is the html we are on. searches for details-box id
            document.addEventListener('mouseover',function (e) { // creates a function for whenever mouseover happens
                if (e.target.tagName == 'circle') { // target is the element acted on by the mouseover event, tagname is in <> in html body
                    var content = e.target.dataset.name; // grabs the data.name of the state
                    //var content = e.target.tagName;
                    //var content = "hey";
                    document.getElementById("details-box").innerHTML = content; //adds state name to pop up box 
                    document.getElementById("details-box").style.opacity = "100%"; // makes box appear or disappear
                    // the text is added to the html, but the actual box is specified in the style.css file
                }
                else {
                    document.getElementById("details-box").style.opacity = "0%";
                }
            });

            window.onmousemove = function (e) {
                var x = e.clientX, // tracks the x position of the mouse
                    y = e.clientY; // tracks the y position of the mouse
                tooltipSpan.style.top = (y+20) + 'px'; // sets y position of box
                tooltipSpan.style.left = (x) + 'px'; // sets x position of box
                // where x and y are zero at the top left of the image/screen
            };

           
        </script>
